from flask import Flask, render_template, request, jsonify, send_from_directory
import os
import boto3
from botocore.exceptions import ClientError

app = Flask(__name__)

# Load common word list from file
def load_common_word_list(file_path='WORDLE_Dictionary.txt'):
    word_list = []
    try:
        # Local file loading
        with open(file_path, 'r') as file:
            for line in file:
                word = line.strip()
                if len(word) == 5:
                    word_list.append(word)
        
        # AWS S3 Integration
        s3_client = boto3.client('s3')
        response = s3_client.get_object(
            Bucket='wordle-solver-dictionaries',
            Key='WORDLE_Dictionary.txt'
        )
        content = response['Body'].read().decode('utf-8')
        for line in content.split('\n'):
            word = line.strip()
            if len(word) == 5:
                word_list.append(word)
            
    except FileNotFoundError:
        # Use a smaller built-in list if file not found
        word_list = ["about", "above", "abuse", "actor", "acute", "admit", "adopt", "adult", "after", "again"]
        # AWS CloudWatch logging would go here in production
        print("Dictionary file not found, using fallback word list")
    return word_list

# Load rare word list
def load_rare_word_list():
    a = ''
    b = ''
    c = ''
    d = ''
    e = ''
    f = ''
    g = ''
    h = ''
    i = ''
    j = ''
    k = ''
    l = ''
    m = ''
    n = ''
    o = ''
    p = ''
    q = ''
    r = ''
    s = ''
    t = ''
    u = ''
    v = ''
    w = ''
    x = 'xebecxeniaxenicxenonxericxeroxxerusxoanaxylanxylemxylicxylolxylylxystixysts'
    y = ''
    z = ''
    
    flw = [a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z]
    li = ''
    for ind in flw:
        li = li + ind

    doc = []
    while len(li) >= 5:
        doc.append(li[:5])
        li = li[5:]
    
    # Filter out any non-5-letter words and ensure they're all lowercase
    doc = [word.lower() for word in doc if len(word) == 5]
    
    # Remove duplicates
    doc = list(set(doc))
    
    # Remove any words that are in the common list
    common_words = load_common_word_list()
    rare_words = [word for word in doc if word not in common_words]
    
    return rare_words

# Filter words with green letters (correct position)
def filter_green(green, current_words):
    res = current_words[:]
    for i in range(5):
        if green[i] != '?':
            current = res[:]
            for j in current:
                if green[i] != j[i]:
                    res.remove(j)
    return res

# Filter words with black letters (not in word)
def filter_black(black, current_words):
    res = current_words[:]
    for letter in black:
        current = res[:]
        for word in current:
            if letter in word:
                res.remove(word)
    return res

# Filter words with yellow letters (in word but wrong position)
def filter_yellow(yellow_letters, yellow_positions, current_words):
    res = current_words[:]
    for letter, pos in zip(yellow_letters, yellow_positions):
        current = res[:]
        for word in current:
            if letter not in word:
                res.remove(word)
            elif word[int(pos)-1] == letter:
                res.remove(word)
    return res

@app.route('/')
def index():
    return render_template('index.html')

@app.route('/favicon.ico')
def favicon():
    return send_from_directory(os.path.join(app.root_path, 'static'),
                               'favicon.ico', mimetype='image/vnd.microsoft.icon')

@app.route('/solve', methods=['POST'])
def solve():
    data = request.get_json()
    
    green = data.get('green', '?????')
    black = data.get('black', '')
    yellow_letters = data.get('yellow_letters', '')
    yellow_positions = data.get('yellow_positions', '')
    
    # Process inputs for common words
    common_words = load_common_word_list()
    
    # Process inputs for rare words
    rare_words = load_rare_word_list()
    
    # Clean black letters that are in green or yellow
    clean_black = ''.join([letter for letter in black if letter not in green and letter not in yellow_letters])
    
    # Apply filters to common words
    filtered_common_words = filter_green(green, common_words)
    filtered_common_words = filter_black(clean_black, filtered_common_words)
    
    if yellow_letters and yellow_positions:
        filtered_common_words = filter_yellow(yellow_letters, yellow_positions, filtered_common_words)
    
    # Apply filters to rare words
    filtered_rare_words = filter_green(green, rare_words)
    filtered_rare_words = filter_black(clean_black, filtered_rare_words)
    
    if yellow_letters and yellow_positions:
        filtered_rare_words = filter_yellow(yellow_letters, yellow_positions, filtered_rare_words)
    
    # Remove any words that appear in both lists (prioritize common words)
    filtered_rare_words = [word for word in filtered_rare_words if word not in filtered_common_words]
    
    return jsonify({
        'common_words': filtered_common_words[:50],  # Limit to 50 common words
        'rare_words': filtered_rare_words[:50]       # Limit to 50 rare words
    })

if __name__ == '__main__':
    app.run(debug=True)